import './App.css';
import About from './about_me';
import Footer from './footer';
import NavBar from './header';
import Intro from './intro';
import Projects from './projects';
import Skills from './skills';

function App() {
  return (
    <div className="App">
      <div className="container-fluid">
        <NavBar />
        <Intro />
        <About />
        <Skills />
        <Projects />
        <Footer />
      </div>
    </div>
  );
}

export default App;
